];
const productItems = items.slice(0, 6);
const graphicItems = items.slice(7);

const ProductCarousel = () => {
  return (
    <AliceCarousel
      autoPlay
      autoPlayStrategy="default"
      autoPlayInterval={1500}
      animationDuration={1500}
      animationType="slide"
      infinite={true}
      items={productItems}
    />
  );
};
const GraphicCarousel = () => {
  return (
    <AliceCarousel
      autoPlay
      autoPlayStrategy="default"
      autoPlayInterval={1500}
      animationDuration={1500}
      animationType="slide"
